//Filters reducer

const filtersReducersDefaultState = {
    text: ''
}

export default (state = filtersReducersDefaultState, action) => {
    switch (action.type) {
        case 'SET_TEXT_FILTER':
            return {
                ...state,
                text: action.type
            }
    }
}
